import styled from 'styled-components'

const Container = styled.div`
  position: relative;
  width: 100vw;
  height: 100vh;
`

const Header = styled.div`
  position: fixed;
  top: 0;
  width: 100vw;
  height: 50px;
  background-color: red;
`

export default ({ children }) => (
  <Container>
    <Header />
    {children}
  </Container>
)
